import React from 'react'

export default function PageNotFound() {
  return (
    <section className="section-container" id="user-lost" >
        <div className="content-container" style = { { height: '50vh', justifyContent: 'center'}}>
          <h3>It looks like you are lost.</h3>
          <p>It looks like you are lost! Do not worry, you will be shortly redirected to the homepage.</p>
        </div>

    </section>
  )
}
